        <script type="text/javascript">
			var onLoad = function() 
			{
					document.addEventListener("deviceready", onDeviceReady, false);
			}
	
			var onDeviceReady = function() 
			{
				document.addEventListener('kepcsik', function(event) {
					   if(event.target.parentNode.className.indexOf('noBounce') != -1 
					|| event.target.className.indexOf('noBounce') != -1 ) {
						event.preventDefault(); }
					}, false);
			}
			
			
			var Anim;	
			function Start()
			{
				Anim = setInterval("Animate()",10);
			}	
				posX = 0;
			function Animate()
			{
				posX += 10;
				//document.getElementById("Display").innerHTML = posX;
				var Obj = document.getElementById("csoport");
				Obj.setAttribute("transform", "rotate(" + parseFloat(posX/10) + " 49 12)");
				if (posX>3600) { clearInterval(Anim); Anim=0; }
			}
			
			
        </script>
